package ci.bhci.bhevaluationpro.domain;import java.util.ArrayList;import java.util.Date;import java.util.List;import javax.persistence.CascadeType;import javax.persistence.Column;import javax.persistence.Entity;import javax.persistence.EntityListeners;import javax.persistence.GeneratedValue;import javax.persistence.GenerationType;import javax.persistence.Id;import javax.persistence.OneToMany;import javax.persistence.Table;import org.springframework.data.jpa.domain.support.AuditingEntityListener;import com.fasterxml.jackson.annotation.JsonIgnoreProperties;import lombok.AllArgsConstructor;import lombok.Getter;import lombok.NoArgsConstructor;import lombok.Setter;/** * Domain Personnel *  * @author kyao * @since 2022-02-02 */@SuppressWarnings("serial")@Entity@Getter@Setter@AllArgsConstructor@NoArgsConstructor@Table(name = "t_personnel")@EntityListeners(AuditingEntityListener.class)@JsonIgnoreProperties(value = { "createdAt", "modifiedAt", "deletedAt" }, allowGetters = true)public class Personnel extends AbstractBaseEntity {	@Id	@GeneratedValue(strategy = GenerationType.IDENTITY)	@Column(name = "id_personnel")	private Long id;	@Column(name = "matricule_personnel", unique = true)	private String matriculePersonnel;	@Column(name = "civilite_personnel")	private String civilitePersonnel;	@Column(name = "nom_personnel")	private String nomPersonnel;	@Column(name = "prenoms_personnel")	private String prenomsPersonnel;	@Column(name = "date_naissance")	private Date dateNaissance;	@Column(name = "email_personnel", unique = true)	private String emailPersonnel;	@Column(name = "photo_personnel")	private String photoPersonnel;	@Column(name = "date_embauche")	private Date dateEmbauche;	@OneToMany(mappedBy = "personnel", cascade = CascadeType.ALL)	private List<PersonnelPoste> personnelPostes = new ArrayList<>();}